import React, { Component } from 'react'

export default class Footer extends Component {
  render() {
    return (
      <div style={{ marginTop: '20px',display:'flex',justifyContent:'space-'}}>
        <label>
          <input type="checkBox" />
          <span>未完成/已完成</span>
        </label>
        <button>清除已选选项</button>
      </div>
    )
  }
}
